import { FC } from "react";
import format from "date-fns/format";

const Habits:FC = ():JSX.Element => {
    return (
        <>
            <div>
                Habits
            </div>
            <div>
                Month: {format(new Date(), 'MM')}
            </div>
        </>
    );
};

export default Habits;
